import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import { useNavigate } from "react-router-dom";
import LoginPage from './LoginPage';
import SignUpPage from './SignUpPage';
import ResetPassword from './ResetPassword';
import './index.css';

function App() {
  const navigate = useNavigate();

  const navigateToLoginPage = () => {
    navigate("/LoginPage");
  };
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home navigateToLoginPage={navigateToLoginPage} />} />
        <Route path="/LoginPage" element={<LoginPage />} />
        <Route path="/SignUpPage" element={<SignUpPage />} />
        <Route path="/ResetPassword" element={<ResetPassword />} />
      </Routes>
    </Router>
  );
}

function Home() {


  return (
    <div className="App">
      <div className="centered-title">
        <p id="logo-text">moodify</p>
      </div>
      <div className="black-button-group">
        <button onClick={navigateToLoginPage}>START</button>
      </div>
      <div>
        <img src="/images/moodifymainpic.png" alt="메인화면사진" className="main-image" />
      </div>
    </div>
  );
}

export default App;
